                </bannerTitle>
                <bannerSubtitle>
                    world
                </bannerSubtitle>
            </banner>
        </div>
        <nav>
        <ul>
            <li><a href="#">Home</a></li>
            <li><a href="#">About</a></li>
            <li><a href="#">Services</a></li>
            <li><a href="#">Contact</a></li>
        </ul>
        </nav>
        </>
    );
};
export default Navbar; 


